import React from "react";
import { Avatar } from "react-lorem-ipsum";
import "./profile.css";


function Profile()
{
    return (
        <div className="card">
            <div className="upper-card">
                <Avatar className="profile-image"/>
            </div>
            <div className="lower-card">
                <h1>Sword of the morning</h1>
            </div>
        </div>
    )
}


export default Profile;
